import React, { useContext } from "react";
import { CartContext } from "../contexts/CartContext";
import { Card, CardMedia, CardContent, Typography, Grid, Container } from "@mui/material";

const Cart: React.FC = () => {
  const cartContext = useContext(CartContext);

  return (
    <Container sx={{ marginTop: 4 }}>
      <Typography variant="h4">Shopping Cart Empty</Typography>
      <Grid container spacing={3}>
        {cartContext?.cart.map((product) => (
          <Grid item xs={12} sm={6} md={4} key={product.id}>
            <Card>
              <CardMedia component="img" height="200" image={product.image} alt={product.title} />
              <CardContent>
                <Typography variant="h6">{product.title}</Typography>
                <Typography variant="body2">${product.price}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Cart;
